const img = 'https://cdn.shopify.com/s/files/1/0757/9955/files/empty-state.svg';

const Index = () => (
  <Page>
    <Layout>
     <TextStyle variation="positive">
      Sample app using React and Next.js
    </TextStyle>
    </Layout>
    </Page>
);

export default Index;
